feature calt {
@CapsOrn=[A Aacute Abreve Abreveacute Abrevedotbelow Abrevegrave Abrevehookabove Abrevetilde Acircumflex Acircumflexacute Acircumflexdotbelow Acircumflexgrave Acircumflexhookabove Acircumflextilde Adieresis Adotbelow Agrave Ahookabove Atilde G Gbreve H J K L Ldot M Q R U Uacute Ucircumflex Udieresis Udotbelow Ugrave Uhookabove Uhorn Uhornacute Uhorndotbelow Uhorngrave Uhornhookabove Uhorntilde Utilde X Y Yacute Ydotbelow Ygrave Yhookabove Ytilde Z $[case == upper AND name endswith ".isol"]];
@Letters=[@Lowercase @CapsOrn];
@CapsIsol=[$[case == upper AND name endswith ".isol"]];
@CapsMedial=[A Aacute Abreve Abreveacute Abrevedotbelow Abrevegrave Abrevehookabove Abrevetilde Acircumflex Acircumflexacute Acircumflexdotbelow Acircumflexgrave Acircumflexhookabove Acircumflextilde Adieresis Adotbelow Agrave Ahookabove Atilde G Gbreve H J K L Ldot M Q R U Uacute Ucircumflex Udieresis Udotbelow Ugrave Uhookabove Uhorn Uhornacute Uhorndotbelow Uhorngrave Uhornhookabove Uhorntilde Utilde X Y Yacute Ydotbelow Ygrave Yhookabove Ytilde Z];
@CapsBottom=[G Gbreve J Y Yacute Ydotbelow Ygrave Yhookabove Ytilde];
@CapsBase=[L Ldot Z]; 

# All base lowercases letters (has unicode + idotaccent), would like to use a token but that one is not supported by GliphsLib
@Medial=[@CapsMedial a aacute abreve abreveacute abrevedotbelow abrevegrave abrevehookabove abrevetilde acircumflex acircumflexacute acircumflexdotbelow acircumflexgrave acircumflexhookabove acircumflextilde adieresis adotbelow agrave ahookabove atilde ae b c ccedilla d dcroat e eacute ebreve ecircumflex ecircumflexacute ecircumflexdotbelow ecircumflexgrave ecircumflexhookabove ecircumflextilde edieresis edotbelow egrave ehookabove etilde f g gbreve h i idotless iacute icircumflex idieresis idotaccent idotbelow igrave ihookabove itilde j jdotless k l ldot m n ntilde o oacute ocircumflex ocircumflexacute ocircumflexdotbelow ocircumflexgrave ocircumflexhookabove ocircumflextilde odieresis odotbelow ograve ohookabove ohorn ohornacute ohorndotbelow ohorngrave ohornhookabove ohorntilde otilde oe p q r s scedilla germandbls t u uacute ucircumflex udieresis udotbelow ugrave uhookabove uhorn uhornacute uhorndotbelow uhorngrave uhornhookabove uhorntilde utilde v w x y yacute ydotbelow ygrave yhookabove ytilde z t_t.liga]; 

@Isolated=[$[name endswith ".isol"]];

@Initial=[@CapsMedial $[name endswith ".init"]];

@Final=[@CapsIsol $[name endswith ".fina"]];

# Letters that need a long connection on the base line
@Base=[@CapsBase e $[name beginswith "e."] $[name beginswith "eacute"] $[name beginswith "ecircumflex"] $[name beginswith "edieresis"] $[name beginswith "edotbelow"] $[name beginswith "egrave"] $[name beginswith "ehookabove"] $[name beginswith "etilde"] oe $[name beginswith "oe."] ae $[name beginswith "ae."] c $[name beginswith "c."] $[name beginswith "ccedilla"] s $[name beginswith "s."] $[name beginswith "scedilla"] $[name beginswith "germandbls"] x $[name beginswith "x."]];

@BaseMedial=[@CapsMedial $[name endswith ".medi.cv01"]];

@BaseFinal=[@CapsIsol $[name endswith ".fina.cv01"]];

# Letters that needs connection from the top
@Top=[b $[name beginswith "b."] o $[name beginswith "o."] $[name beginswith "oacute"] $[name beginswith "ocircumflex"] $[name beginswith "odieresis"] $[name beginswith "odotbelow"] $[name beginswith "ograve"] $[name beginswith "ohookabove"] $[name beginswith "ohorn"] $[name beginswith "otilde"] v $[name beginswith "v."] w $[name beginswith "w."]];

@TopMedial=[@CapsMedial $[name endswith ".medi.cv02"]];

@TopFinal=[@CapsIsol $[name endswith ".fina.cv02"]];

# Letters that needs connection from the bottom
@Bottom=[@CapsBottom j $[name beginswith "j."] $[name beginswith "jdotless"] g $[name beginswith "g."] $[name beginswith "gbreve"] q $[name beginswith "q."] y $[name beginswith "y."] $[name beginswith "yacute"] $[name beginswith "ydotbelow"] $[name beginswith "ygrave"] $[name beginswith "yhookabove"] $[name beginswith "ytilde"] z $[name beginswith "z."]];

@BottomMedial=[@CapsMedial $[name endswith ".medi.cv03"]];

@BottomFinal=[@CapsIsol $[name endswith ".fina.cv03"]];

lookup ISOLATED {
	lookupflag IgnoreMarks;
	ignore sub @Medial' @Lowercase, @Letters @Medial';
	sub @Medial' by @Isolated;
} ISOLATED;

lookup INITIAL {
	lookupflag IgnoreMarks;
	ignore sub @Letters @Medial';
	sub @Medial' by @Initial;
} INITIAL;

lookup FINAL {
	lookupflag IgnoreMarks;
	ignore sub @Medial' @Lowercase;
	sub @Base @Medial' by @BaseFinal;
	sub @Top @Medial' by @TopFinal;
	sub @Bottom @Medial' by @BottomFinal;
	sub @Medial' by @Final;
} FINAL;	

lookup MEDIAL {
	lookupflag IgnoreMarks;
	sub @Base @Medial' by @BaseMedial;
	sub @Top @Medial' by @TopMedial;
	sub @Bottom @Medial' by @BottomMedial;
} MEDIAL;

