 ocircumflexacute.isol ocircumflexdotbelow.isol ocircumflexgrave.isol ocircumflexhookabove.isol ocircumflextilde.isol odieresis.isol odotbelow.isol ograve.isol ohookabove.isol ohorn.isol ohornacute.isol ohorndotbelow.isol ohorngrave.isol ohornhookabove.isol ohorntilde.isol otilde.isol oe.isol p.isol q.isol r.isol s.isol scedilla.isol t.isol u.isol uacute.isol ucircumflex.isol udieresis.isol udotbelow.isol ugrave.isol uhookabove.isol uhorn.isol uhornacute.isol uhorndotbelow.isol uhorngrave.isol uhornhookabove.isol uhorntilde.isol utilde.isol v.isol w.isol x.isol y.isol yacute.isol ydotbelow.isol ygrave.isol yhookabove.isol ytilde.isol z.isol t_t.liga.isol];

